import Alerts from './alerts/alerts'
import Navigation from './navigation/navigation'
import Settings from './settings/settings'

let optionsContainer = {
    display: 'flex',
    width: 300,
    height: 30,
    margin: "10px 0 0 10px",
    marginLeft: 'auto',
    flexWrap: 'wrap'
}

let optionsMenuContainer = {
    display: 'flex',
    width: 299
}

let optionsDdl = {
    width: 299,
    height: 400,
    backgroundColor: "#063b50"
}

export default function Options() {
    return (
        <span style={optionsContainer}>
            <span style={optionsMenuContainer}>
                <Navigation/>
                <Alerts/>
                <Settings/>
            </span>

            <div style={{width: 299, height: 400, backgroundColor: 'blue'}}>

            </div>
        </span>
    )
}
